import { useEffect, useState } from 'react';
import Axios from 'axios';

export const useAddUser = currentUser => {
  console.log(currentUser);

  useEffect(() => {
    Axios.post('http://localhost:3001/create', {
      userName: currentUser,
    }).then(() => console.log('success'));
  });
};
